import React, { useContext } from "react";

import { DriveToolbarContext } from "../../../pages/DrivesListPage";

import { InputWrapper } from "../../../styled/containers";
import {
  makeStyles,
  InputLabel,
  OutlinedInput,
  TextField,
} from "@material-ui/core";

import SearchIcon from "@material-ui/icons/Search";
const useStyles = makeStyles({
  label: {
    paddingLeft: "12px",
  },
  search: { marginRight: "8px" },
});

export const DriveSearch = () => {
  const { searchValue, setSearchValue } = useContext(
    DriveToolbarContext
  ).searchContext;
  const classes = useStyles();
  return (
    // <InputWrapper width="auto">
    //   <InputLabel className={classes.label}>Search</InputLabel>
    //   <OutlinedInput
    //     className={classes.search}
    //     placeholder="Title"
    //     value={searchValue}
    //     label="Search"
    //     color="primary"
    //     notched={false}
    //     endAdornment={<SearchIcon />}
    //     variant="outlined"
    //     onChange={(e) => setSearchValue(e.target.value)}
    //   />
    // </InputWrapper>
    <TextField
      className={classes.search}
      id="drive-search-input"
      label="Search"
      variant="outlined"
      color="primary"
      value={searchValue}
      placeholder="Number or Show Title"
      onChange={(e) => setSearchValue(e.target.value)}
      endAdornment={<SearchIcon />}
    />
  );
};
